import React from 'react';
import ReactDOM from 'react-dom';
import Name from './Name.js';
import logo from './assets/images/logo.svg';
import logoRed from './assets/images/logoRed.png';
import logoYellow from './assets/images/logoYellow.png';
import logoGreen from './assets/images/logoGreen.png';
import js from './assets/images/js.png';
import shakaWhite from './assets/images/shakaWhite.png';
import shakaBlack from './assets/images/shakaBlack.png';
import './css/App.css';

let element = (<div></div>);
let timeItIs = [
  "shaka time!!!",
  "get a wave brah!",
  "keep froth alive...",
];
let x = 0;
let interval = 0;
let timeItIsNow = timeItIs[x];
const tick = () => {
  element = (
    <div className="time mt-40">
      <div className='color-red'>do you know what time it is?</div><br/><b>{new Date().toLocaleTimeString().replace(" ","").toLocaleLowerCase()}</b><br/><br/><div className='color-green'><b>{ timeItIsNow }</b></div>
    </div>
  );

  interval = (interval === 3) ? 0 : (interval+1);
  x = (x === (timeItIs.length-1) && (interval === 0)) ? 0 : ((interval === 0) ? (x+1) : x);
  timeItIsNow = timeItIs[x];
  ReactDOM.render(element, document.getElementById('time'));
}
setInterval(tick, 1000);

function App() {
  return (
    <div className="App">
      <div className="flexContainer header">
        <div className="flex3Column bg-green" />
        <div className="flex3Column bg-yellow" />
        <div className="flex3Column bg-red" />
      </div>
      <header className="App-header">
        <img src={shakaBlack} className="App-js logo" alt="js" />
        <div className="flexContainer">
          <div className="flex3Column height200" />
          <div className="flex3Column height200">
            <img src={logoRed} className="App-logo1 logo height200 ml-100" alt="logoRed" />
            <img src={logoYellow} className="App-logo2 logo height200 ml-100" alt="logoYellow" />
            <img src={logoGreen} className="App-logo3 logo height200 ml-100" alt="logoGreen" />
          </div>
          <div className="flex3Column height200" />
        </div>
          <Name />
        <a className="App-link"
          href="https://jsongithub.github.io/portfolio/"
          target="_self"
          rel="noopener noreferrer"
        >
          portfolio
        </a>
        <div id="time">{ element }</div>
      </header>
      <div className="flexContainer footer">
        <div className="flex3Column bg-red" />
        <div className="flex3Column bg-yellow" />
        <div className="flex3Column bg-green" />
      </div>
    </div>
  );
}

export default App;
